    console.log(popularChef)
      return (<>
      <div id="chef-of-the-week">
        <h1>Chef of the week:</h1>
        <div>
            <section id="chef-img">
            <img src={popularChef?.img} alt=""  />
            <h1>{popularChef?.name}</h1>
            </section>
            <p id="chef-about">{popularChef?.about}</p>
        </div>
        <div id="rest-div">
            

        </div>
      </div>

        </>
      )
    }

